import React from 'react';
import { AppBar, Button, Toolbar, Typography, Stack } from '@mui/material';

const NavBar = () => {
    return (
        <React.Fragment>
            <AppBar position='static'>
                <Toolbar sx={{ display: 'flex', flexDirection: 'column', alignItems: 'center', }}>
                    <Stack direction='row' spacing={2}>
                        <Button color='inherit' href='/'>Home</Button>
                        <Button color='inherit' href='/QuemSomos'>Quem Somos</Button>
                        <Button color='inherit' href='/ContratacaoPlanos'>Planos</Button>
                        <Button color='inherit' href='/Contato'>Contato</Button>
                    </Stack>
                </Toolbar>
            </AppBar>
        </React.Fragment>
    );
}

export default NavBar;
